The Council require the services of an organisation or group of organisations to provide a comprehensive integrated health and wellbeing service for young people aged 10-19 (and particularly vulnerable young people aged 19-25 years old) in Tower Hamlets. The key objectives of the service are to:
•	Promote health and wellbeing through health promotion, education and, where appropriate, treatment for sexual ill health and substance misuse;
•	Provide a welcoming, accessible service with a clear culture of ongoing enquiry and challenge to 'normalised' harmful practices;
•	Provide brief interventions for young people engaging in behaviours that may become harmful to their health and wellbeing;
•	Identify and deliver targeted education and early intervention programmes to groups/individuals at risk;
•	Provide advice and information for young people and their parents/carers on exploratory risky behaviours including sexual health and substance misuse;
•	Ensure services are acceptable and accessible to people disproportionately affected by unintended pregnancy, sexual ill health and harms associated with substance misuse based on up to date needs assessment;
•	Enable those young people who are unable to stop using drugs to stabilise their drug use and minimise harm;
•	Provide testing and treatment programmes for children and young people that address sexual health and/or substance misuse needs (alcohol, drugs and tobacco);
•	Support service users' children and young people in returning to school/further education/training/employment to reduce the risk of relapse into harmful behaviours;
•	Participate in partnership working with other relevant agencies including mutually agreed reciprocal staff training where appropriate for key staff groups; 
•	Transition into adult services, this will include contributing to  transitional care plan;
•	Collect demographic data relating to behaviours, referrals, utilisation of services and programmes in addition to general service activity and quality data and provide this as part of the JSNA process in the local authority area;
•	Promote self-efficacy and health literacy.

Please note: if PHE does not get interest in the project, then PHE will not issue a tender but will do a direct award to a supplier.
Express interest at: 

https://phe.bravosolution.co.uk/esop/guest/go/opportunity/detail?opportunityId=31334

Provision of specific reports to the European Monitoring Centre for Drugs and Drug Addiction (EMCDDA) when new substances appear in the UK. 
 
The Early Warning System (EWS) on New Psychoactive Substances was established through a European Council Decision and is required to be implemented through National Focal Points. In the UK, the network is currently co-ordinated by a chemist and an academic working in the field of drugs. 
Specific Tasks are:
     Provision of support to the EWS expert and network, by organising and minuting meetings, assisting in the production and submission of reports on the operation of the EWS to the EMCDDA
     Act as a central point for co-ordinating chemical analytical activities amongst laboratory-based network members;
     Maintain and co-ordinate a network of specialists in forensic science, toxicology and others across the United Kingdom, and regularly contact them to obtain information required for the EWS. This regular liaison is carried out mostly by e-mail. Network members are encouraged to discuss, at national level, information on new substances and new developments at an early stage even if substantive evidence is limited;
     6-monthly reports to the EMCDDA detailing occurrences of substances covered by the EWS as notified by organisations participating in the network; carry out background research to identify basic information (chemistry, availability, pharmacology and toxicology) where feasible. Obtain analytical data on the new substance from the network sources;
      Be the national (UK) contact for the EMCDDA, receiving information from it and disseminating this within the UK as appropriate. Be available to deal with telephone and e-mail enquiries from EMCDDA on a wide range of issues.
      detailed responses to specific requests from the EMCDDA for more information on new psychoactive substances, for example, prior to risk-assessment;
      participation in expert meetings within the UK and organised by the EMCDDA;
      Providing replies to ad hoc requests from the EMCDDA and Department of Health (When information requested is not readily available, the Focal Point is expected  - within the limits of its available resources - to make reasonable efforts to obtain this information;
     Keep the Head of Focal Point informed of any developments concerning the EWS, which may have an impact on the operation of the Focal Point.
 In addition, the contractor will from time to time be required to coordinate and/or contribute, and often under the guidance of the Head of the Focal Point, to other ad-hoc requests relevant to the EWS such as:
•         Deal with specific requests from Home Office/Advisory Council on Misuse of Drugs (ACMD) on EWS matters
etc

Please note: if PHE does not get interest in the project, then PHE will not issue a tender but will do a direct award to a supplier.
